// src/components/NetworkLogging.js
import React from 'react';
import './NetworkLogging.css';

function NetworkLogging() {
  return (
    <div className="logging-container">
      <div className="logging-card">
        <h2>Network Logger</h2>
        <p>
          Our Network Logger meticulously records all network activities, providing detailed logs that
          help you monitor traffic, detect anomalies, and ensure compliance with security protocols.
          Analyze historical data to maintain a secure and efficient network environment.
        </p>
        <div className="logging-video">
          <video controls poster="/network-logging-placeholder.jpg">
            <source src="/network-logging-demo.mp4" type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        </div>
      </div>
    </div>
  );
}

export default NetworkLogging;
